import React from 'react';
import { Nav } from 'react-bootstrap';
interface Props {}

export default function Pagination(props: Props) {
	return (
		<Nav>
			<ul className="pagination">
				<li className="page-item">
					<a className="page-link"></a>
				</li>
			</ul>
		</Nav>
	);
}
